import React from 'react';
import style from './card.module.css';
const Card = function (props) {
   return (
      <div className='conteiner'>
         <button onClick={props.onClose} className='close'>X</button>
         <h2>{props.name}</h2>
         <h2>{props.status}</h2>
         <h2>{props.species}</h2>
         <h2>{props.gender}</h2>
         <h2>{props.origin}</h2>
         <img src={props.image} alt='Rick Sanchez' />
      </div>
   );
}
export default Card;
